(1,1,'Forgotten Realms: Demon Stone','Forgotten Realms: Demon Stone','','','demon-stone','demon-stone','','',38.73,-1,'1','0','<p>In the dark and twisted cities of tomorrow, corporate syndicates compete for global dominance. But the boardroom deals and corporate takeovers of the future look very different from today: they are lead by marketing directors who manage teams of half-men, half-machine cyborgs with no conscience and plenty of guns. <br /><br />You are an ambitious marketing director in the Syndicate, hand-picked to lead a team of cyborg mercenaries. You work in the problem-solving department and you are damn good at \"taking care\" of problems. Some might say that violence is not the answer but you know better. There here are hardly any problems that you can\'t solve with a well-placed bullet. Collateral damage in the local population and infrastructure during the “negotiations” is, as always, acceptable. After all, what would you expect form the dystopian futuristic world run by mega-corporations? <br /><br />Syndicate is Bullfrog’s masterpiece of a game in which you aren’t saving the world or protecting innocents. You just make sure that your employers get what they want. At your disposal are four cyborg agents, an impressive arsenal of weapons and gadgets, and a massive selection of cybernetic upgrades. You are free to unleash this power on a highly interactive map where you can blow up buildings, steal cars, light trees on fire, or just shoot stuff. Produced by Peter Molyneux himself, Syndicate is the essence of cyberpunk and, with its great music, stylized visuals, and mind-blowing atmosphere, it has earned its place among the best games of all time. Make sure to check out the game that secured Bullfrog\'s place in game development hall of fame.</p>','<p>In the dark and twisted cities of tomorrow, corporate syndicates compete for global dominance. But the boardroom deals and corporate takeovers of the future look very different from today: they are le