dystopian futuristic world run by mega-corporations? Syndicate is Bullfrog’s masterpiece of a game in which you aren’t saving the world or protecting innocents. You just make sure that your employers get what they want. At your disposal are four cyborg agents, an impressive arsenal of weapons and gadgets, and a massive selection of cybernetic upgrades. You are free to unleash this power on a highly interactive map where you can blow up buildings, steal cars, light trees on fire, or just shoot stuff. Produced by Peter Molyneux himself, Syndicate is the essence of cyberpunk and, with its great music, stylized visuals, and mind-blowing atmosphere, it has earned its place among the best games of all time. Make sure to check out the game that secured Bullfrog&#39;s place in game development hall of fame.',NULL,NULL,1248,'thumb.jpg',NULL,'[]','FILE_ljnenlj8y3HKJDF.zip','DrvYThQYWkTOng2p','2016-10-06 21:20:46',1),
(2,2,'Myst Masterpiece Edition','Myst Masterpiece Edition','','','myst','myst','','',33.71,-1,'2,3,6','2,3','<p>Alone on a mysterious island, you set out to explore its grandeur and mystery. Hear how a chilling tale of intrigue and treachery, defying all boundaries of space and time, is being told. Summon your wits and imagination. Every scrap of paper and ambient sound may provide the vital clues which allow hidden secrets to unravel a part of the mystery and lead you one step closer to reversing a wrong that has gone unchecked for ages.</p>','<p>Alone on a mysterious island, you set out to explore its grandeur and mystery. Hear how a chilling tale of intrigue and treachery, defying all boundaries of space and time, is being told. Summon your wits and imagination. Every scrap of paper and ambient sound may provide the vital clues which allow hidden secrets to unravel a part of the mystery and lead you one step closer to reversing a wrong that has gone unchecked for ages.</p>',NULL,NULL,'','',NULL,NULL,'Alone on a mysterious island, you set out to explore its grandeur and mystery. Hear how a chilling tale of intrigue and treachery, defying all boundaries of space and time, is being told. Summon your wits and imagination. Every scrap of paper and ambient sound may provide the vital clues which allow hidden secrets to unravel a part of the mystery and lead you one step closer to reversing a wrong that has gone unchecked for ages.','Alone on a mysterious island, you set out to explore its grandeur and mystery. Hear how a chilling tale of intrigue and treachery, defying all boundaries of space and time, is being told. Summon your wits and imagination. Every scrap of paper and ambient sound may provide the vital clues which allow hidden secrets to unravel a part of the mystery and lead you one step closer to reversing a wrong that has gone unchecked for ages.',NULL,NULL,1854,'thumb.jpg',NULL,'[]','FILE_ljnenlj8y3HKJDF.zip','0n8beFVCl7hxWY2c','2016-10-21 21:24:41',1),
(3,3,'Legend of Grimrock','Legend of Grimrock','','','grim','grim','','',15.31,-1,'3','0','<p>Legend of Grimrock is a dungeon crawling role playing game with an oldschool heart mated with modern execution. A group of prisoners are sentenced to certain death by exile to the secluded Mount Grimrock for vile crimes they may or may not have committed. Unbeknownst to the captives, the mountain is riddled with ancient tunnels, dungeons and tombs built by crumbled civilizations of days long past</p>','<p>Legend of Grimrock is a dungeon crawling role playing game with an oldschool heart mated with modern execution. A group of prisoners are sentenced to certain death by exile to the secluded Mount Grimrock for vile crimes they may or may not have committed. Unbeknownst to the captives, the mountain is riddled with ancient tunnels, dungeons and tombs built by crumbled civilizations of days long past</p>',NULL,NULL,'','',NULL,NULL,'Legend of Grimrock is a dungeon crawling role playing game with an oldschool heart mated with modern execution. A group of prisoners are sentenced to certain death by exile to the secluded Mount Grimrock for vile crimes they may or may not have committed. Unbeknownst to the captives, the mountain is riddled with ancient tunnels, dungeons and tombs built by crumbled civilizations of days long past','Legend of Grimrock is a dungeon crawling role playing game with an oldschool heart mated with modern execution. A group of prisoners are sentenced to certain death by exile to the secluded Mount Grimrock for vile crimes they may or may not have committed. Unbeknownst to the captives, the mountain is riddled with ancient tunnels, dungeons and tombs built by crumbled civilizations of days long past',NULL,NULL,2305,'thumb.jpg',NULL,'[]','FILE_ljnenlj8y3HKJDF.zip','A2LgzV2DH5ORCIMW','2016-10-30 04:14:50',1),
(4,4,'Moto Racer','Moto Racer','','','moto-racer','moto-racer','','',11.41,-1,'4','4','<p>A legend among motorcycle racers and the most memorable game of its kind to ever hit the PC market. Offering a superb blend of lightning-fast superbike racing and hairpin curve-infested motocross events, it became an instant classic. It\'s got a bunch of nifty features, like two driving models (arcade and simulation), vivid graphics that look pretty nice even today and a broad selection of motorcycles to choose from</p>','<p>A legend among motorcycle racers and the most memorable game of its kind to ever hit the PC market. Offering a superb blend of lightning-fast superbike racing and hairpin curve-infested motocross events, it became an instant classic. It\'s got a bunch of nifty features, like two driving models (arcade and simulation), vivid graphics that look pretty nice even today and a broad selection of motorcycles to choose from</p>',NULL,NULL,'','',NULL,NULL,'A legend among motorcycle racers and the most memorable game of its kind to ever hit the PC market. Offering a superb blend of lightning-fast superbike racing and hairpin curve-infested motocross events, it became an instant classic. It&#39;s got a bunch of nifty features, like two driving models (arcade and simulation), vivid graphics that look pretty nice even today and a broad selection of motorcycles to choose from','A legend among motorcycle racers and the most memorable game of its kind to ever hit the PC market. Offering a superb blend of lightning-fast superbike racing and hairpin curve-infested motocross events, it became an instant classic. It&#39;s got a bunch of nifty features, like two driving models (arcade and simulation), vivid graphics that look pretty nice even today and a broad selection of motorcycles to choose from',NULL,NULL,321,'thumb.jpg',NULL,'[]','FILE_ljnenlj8y3HKJDF.zip','MqRnQvjrd8YzJXPC','2016-11-02 04:36:06',1),
(5,5,'Neverwinter Nights Diamond','Neverwinter Nights Diamond','','','neverwinter-nights','neverwinter-nights','','',0.00,-1,'5','0','<p>Experience one of the most popular role-playing adventures of our time, a journey that has thrilled millions. Inhabit dreamlike worlds of myth and mystery. Boundless lands of deadly creatures, foreboding omens and bold heroism. <br /><br />This game puts you at the center of an epic tale of faith, war and betrayal, all the while staying true to the pen-and-paper role-playing tradition</p>','<p>Experience one of the most popular role-playing adventures of our time, a journey that has thrilled millions. Inhabit dreamlike worlds of myth and mystery. Boundless lands of deadly creatures, foreboding omens and bold heroism. <br /><br />This game puts you at the center of an epic tale of faith, war and betrayal, all the while staying true to the pen-and-paper role-playing tradition</p>',NULL,NULL,'','',NULL,NULL,'Experience one of the most popular role-playing adventures of our time, a journey that has thrilled millions. Inhabit dreamlike worlds of myth and mystery. Boundless lands of deadly creatures, foreboding omens and bold heroism. This game puts you at the center of an epic tale of faith, war and betrayal, all the while staying true to the pen-and-paper role-playing tradition','Experience one of the most popular role-playing adventures of our time, a journey that has thrilled millions. Inhabit dreamlike worlds of myth and mystery. Boundless lands of deadly creatures, foreboding omens and bold heroism. This game puts you at the center of an epic tale of faith, war and betrayal, all the while staying true to the pen-and-paper role-playing tradition',NULL,NULL,5862,'thumb.jpg',NULL,'[{\"name\":\"nwnd1.jpg\"},{\"name\":\"nwnd2.jpg\"},{\"name\":\"nwnd3.jpg\"},{\"name\":\"nwnd5.jpg\"}]','FILE_ljnenlj8y3HKJDF.zip','iLpshMpgfXh2g3Gg','2016-11-10 07:38:21',1),
(6,5,'Witcher 2: Assassins Of Kings, The - Enhanced Edition','Witcher 2: Assassins Of Kings, The - Enhanced Edition','Witcher 2: Assassins Of Kings, The - Enhanced Edition','Witcher 2: Assassins Of Kings, The - Enhanced Edition','witcher-2','witcher-2','witcher-2-assassins-of-kings-the-enhanced-edition','witcher-2-assassins-of-kings-the-enhanced-edition',29.85,-1,'5','0','<p>The second installment in the RPG saga about the Witcher, Geralt of Rivia. A new, modern game engine, responsible both for beautiful visuals and sophisticated game mechanics puts players in the most lively and believable world ever created in an RPG game. A captivating story, dynamic combat system, beautiful graphics, and everything else that made the original Witcher such a great game are now executed in a much more advanced and sophisticated way.</p>','<p>The second installment in the RPG saga about the Witcher, Geralt of Rivia. A new, modern game engine, responsible both for beautiful visuals and sophisticated game mechanics puts players in the most lively and believable world ever created in an RPG game. A captivating story, dynamic combat system, beautiful graphics, and everything else that made the original Witcher such a great game are now executed in a much more advanced and sophisticated way.</p>','','','','','','','The second installment in the RPG saga about the Witcher, Geralt of Rivia. A new, modern game engine, responsible both for beautiful visuals and sophisticated game mechanics puts players in the most lively and believable world ever created in an RPG game. A captivating story, dynamic combat system, beautiful graphics, and everything else that made the original Witcher such a great game are now executed in a much more advanced and sophisticated way.','The second installment in the RPG saga about the Witcher, Geralt of Rivia. A new, modern game engine, responsible both for beautiful visuals and sophisticated game mechanics puts players in the most lively and believable world ever created in an RPG game. A captivating story, dynamic combat system, beautiful graphics, and everything else that made the original Witcher such a great game are now executed in a much more advanced and sophisticated way.','','',10255,'thumb.jpg','poster.jpg','[]','FILE_ljnenlj8y3HKJDF.zip','wLVRJnYQu7iWS2He','2016-11-30 07:45:56',1),
(7,5,'Baldur&#39;s Gate II: Enhanced Edition','Baldur&#39;s Gate II: Enhanced Edition','Baldur&#39;s Gate II: Enhanced Edition','Baldur&#39;s Gate II: Enhanced Edition','baldurs-gate-2-enhanced-edition','baldurs-gate-2-enhanced-edition','baldurs-gate-2-enhanced-edition','baldurs-gate-2-enhanced-edition',11.42,-1,'5','0','<p>Kidnapped. Imprisoned. Tortured. The wizard Irenicus holds you captive in his stronghold, attempting to strip you of the powers that are your birthright.</p>\r\n<p>Can you resist the evil within you, forge a legend of heroic proportions, and ultimately destroy the dark essence that haunts your dreams?</p>','<p>Kidnappé. Emprisonnés. Torturé. Le sorcier Irenicus vous retient captif dans sa forteresse, tentant de vous priver des pouvoirs qui vous reviennent de naissance.</p>\r\n<p>Pourrez-vous résister au mal qui est en vous, forger une légende aux proportions héroïques, et finalement détruire la sombre essence qui hante vos rêves ?</p>','<p>Ontvoerd. Gevangen gezet. Gemarteld. De tovenaar Irenicus houdt je gevangen in zijn bolwerk, in een poging je de krachten te ontnemen die je geboorterecht toekomen.<br><br>Kun jij het kwaad in je weerstaan, een legende van heldhaftige proporties smeden, en uiteindelijk de duistere essentie vernietigen die in je dromen rondwaart?</p>','<p>Gekidnappt. Inhaftiert. Gefoltert. Der Zauberer Irenicus hält dich in seiner Festung gefangen und versucht, dich der Kräfte zu berauben, die dein Geburtsrecht sind.<br></p>\r\n<p><br>Kannst du dem Bösen in dir widerstehen, eine Legende von heldenhaftem Ausmaß schmieden und schließlich die dunkle Essenz vernichten, die deine Träume heimsucht?</p>','','','','','Kidnapped. Imprisoned. Tortured. The wizard Irenicus holds you captive in his stronghold, attempting to strip you of the powers that are your birthright.\r\nCan you resist the evil within you, forge a legend of heroic proportions, and ultimately destroy the dark essence that haunts your dreams?','Kidnappé. Emprisonnés. Torturé. Le sorcier Irenicus vous retient captif dans sa forteresse, tentant de vous priver des pouvoirs qui vous reviennent de naissance.\r\n\r\nPourrez-vous résister au mal qui est en vous, forger une légende aux proportions héroïques, et finalement détruire la sombre essence qui hante vos rêves ?','Ontvoerd. Gevangen gezet. Gemarteld. De tovenaar Irenicus houdt je gevangen in zijn bolwerk, in een poging je de krachten te ontnemen die je geboorterecht toekomen.\r\n\r\nKun jij het kwaad in je weerstaan, een legende van heldhaftige proporties smeden, en uiteindelijk de duistere essentie vernietigen die in je dromen rondwaart?','﻿﻿Gekidnappt. Inhaftiert. Gefoltert. Der Zauberer Irenicus hält dich in seiner Festung gefangen und versucht, dich der Kräfte zu berauben, die dein Geburtsrecht sind.\r\n\r\n\r\nKannst du dem Bösen in dir widerstehen, eine Legende von heldenhaftem Ausmaß schmieden und schließlich die dunkle Essenz vernichten, die deine Träume heimsucht?',306,'thumb.jpg',NULL,'[]','FILE_ljnenlj8y3HKJDF.zip','mge656UcGoOZE40G','2016-12-22 08:13:29',1),
(8,1,'Test Product','Test produit','dsqdqs','dsqdqsdsq','test-product','test-product','test-product','test-product',0.00,5,'1','0','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Vestibulum morbi blandit cursus risus at ultrices mi tempus.</p>','<p> <strong></strong><strong>Matériel :</strong> Ballons de baudruche, Balles de tennis, Cerceaux</p>\r\n<p><strong>Âges</strong> : 8-10 ans, 10-12 ans, 12-15 ans, 15 ans et <br></p>\r\n<p>---</p>\r\n<p>Regardez cette activité sympa ; elle permet de travailler les compétences sportives suivantes : temps de réaction, coordination main-œil, agilité. </p>\r\n<p><strong>Comment jouer ? </strong></p>\r\n<p>Disposer plusieurs balles de plus en plus loin ainsi qu\'un cerceau dans lequel déposer les balles. A l\'aide d\'un bâton, il faut arriver à conserver le ballon de baudruche en l\'air tout en attrapant les balles au sol une par une et les ramener dans le cerceau</p>\r\n<p><strong>Sécurité</strong></p>\r\n<p>Ne pas placer les ateliers trop proches l\'un de l\'autre afin d\'éviter les collisions</p>\r\n<p><strong>Comment améliorer ? </strong></p>\r\n<p>- Plus de balles<br>- Eloigner les balles<br>- Ne pas prendre de bâton mais réaliser avec la main</p>\r\n<p><strong>Conseils </strong></p>\r\n<ul><li>Sur quel objet votre attention doit-elle se porter ? </li><li>Comment gérer le temps de \"vol\" de votre ballon ?  </li></ul>\r\n<p><strong>Note pour l\'enseignant</strong></p>\r\n<p>Lorsqu\'un ballon touche le sol, demander à l\'élève de replacer la dernière balle de tennis et ensuite redémarrer.</p>','','','','','','','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Vestibulum morbi blandit cursus risus at ultrices mi tempus.',' Matériel : Ballons de baudruche, Balles de tennis, Cerceaux\r\nÂges : 8-10 ans, 10-12 ans, 12-15 ans, 15 ans et \r\n---\r\nRegardez cette activité sympa ; elle permet de travailler les compétences sportives suivantes : temps de réaction, coordination main-œil, agilité. \r\nComment jouer ? \r\nDisposer plusieurs balles de plus en plus loin ainsi qu&#39;un cerceau dans lequel déposer les balles. A l&#39;aide d&#39;un bâton, il faut arriver à conserver le ballon de baudruche en l&#39;air tout en attrapant les balles au sol une par une et les ramener dans le cerceau\r\nSécurité\r\nNe pas placer les ateliers trop proches l&#39;un de l&#39;autre afin d&#39;éviter les collisions\r\nComment améliorer ? \r\n- Plus de balles- Eloigner les balles- Ne pas prendre de bâton mais réaliser avec la main\r\nConseils \r\nSur quel objet votre attention doit-elle se porter ? Comment gérer le temps de &#34;vol&#34; de votre ballon ?  \r\nNote pour l&#39;enseignant\r\nLorsqu&#39;un ballon touche le sol, demander à l&#39;élève de replacer la dernière balle de tennis et ensuite redémarrer.','','',5,'seLWg1iKp1Xk.png',NULL,'[{\"name\":\"IMG_WCoeHPOLyabt.png\"},{\"name\":\"IMG_EkKVvVFzLnjF.png\"},{\"name\":\"IMG_nlo1B9n6Iagk.png\"}]','UaqQQFrjBPNb.pdf','A9eyo0RjP2FHQeQZ','2022-02-23 16:25:44',1);
