    </div>\n    </div>\n  </div>\n  \n  <div class=\"section\" style=\"padding: 32px 0px 50px; margin-top: 0px; margin-bottom: 0px; border: 0px solid rgb(0, 0, 0); box-shadow: rgba(0, 0, 0, 0.2) 0px 0px 0px 0px;\">\n  <div class=\"wojo-grid\">\n    <div class=\"row gutters align center\">\n      <div class=\"columns screen-50 tablet-60 mobile-100 phone-100\">\n        <div class=\"center aligned\" data-weditable=\"true\">\n          <span class=\"wojo primary inverted label\" data-type=\"label\">Company Values</span>\n          <h2 class=\"margin top wojo divided text\">Notre <span class=\"wojo primary text\">FAQ</span></h2>\n        </div>\n      </div>\n    </div>\n    <div class=\"row grid gutters screen-3 tablet-3 mobile-2 phone-1\">\n      <div class=\"columns\">\n        <div data-weditable=\"true\" class=\"\">\n          <h6 class=\"underlined\">Essai gratuit</h6>\n          <p class=\"\">L\'essai gratuit du service vous permet de créer un compte et de connaitre notre application. Pendant l\'essai gratuit, certains sports sont débloqués mais avec des fonctionnalités limitées ou manquantes. Lors de la souscription à un abonnement, tous les fonctionnalités seront débloquées.</p></div>\n      </div>\n      <div class=\"columns\">\n        <div data-weditable=\"true\" class=\"\">\n          <h6 class=\"underlined\">Prélèvement annuel</h6>\n          <p class=\"\">Cela signifie que le paiement s\'effectue en une seule fois pour l\'année complète (date à date) au lieu de chaque mois. Cette solution vous permet d\'avoir un prix plus avantageux.</p><p class=\"\"><br></p>\n        </div>\n      </div>\n      <div class=\"columns\">\n        <div data-weditable=\"true\" class=\"\">\n          <h6 class=\"underlined\">Renouvellement automatique</h6>\n          <p class=\"\">Celui-ci se fait automatiquement (uniquement pour les paiements STRIPE ou PAYPAL). L\'annulation du renouvellement automatique peut se faire à tout moment dans votre compte.</p>\n        </div>\n      </div>\n      <div class=\"columns\">\n        <div data-weditable=\"true\" class=\"\">\n          <h6 class=\"underlined\">Annulation abonnement</h6>\n          <p class=\"\">Il est possible d\'annuler votre abonnement quand vous le désirez à partir des paramètres de votre compte.</p>\n        </div>\n      </div>\n      <div class=\"columns\">\n        <div data-weditable=\"true\" class=\"\">\n          <h6 class=\"underlined\">Facture</h6>\n          <p class=\"\">Elle est éditée automatiquement lors de votre paiement et se trouve dans votre compte. Le cas échéant, contactez-nous pour modifier le nom (association, établissement, etc.), ajouter un numéro de TVA ou l\'adresse de facturation.</p>\n        </div>\n      </div>\n      <div class=\"columns\">\n        <div data-weditable=\"true\" class=\"\">\n          <h6 class=\"underlined\">Réduction</h6>\n          <p class=\"\">Des coupons de réductions sont parfois  disponibles et limités dans le temps. Veuillez l\'utiliser avant le paiement.</p>\n        </div>\n      </div>\n    </div>\n  </div>\n</div><div class=\"section\" style=\"background-color: #f2f2fe;padding:96px 0 64px 0\" id=\"aialfG7\">\n  <div class=\"wojo-grid\">\n    <div class=\"row big gutters align center\">\n<div class=\"columns screen-50 tablet-70 mobile-100 phone-100\">\n  <div data-weditable=\"true\" class=\"center aligned\">\n<span class=\"wojo primary inverted label\" data-type=\"label\">Plugins</span>\n<h3 class=\"divided margin top\">Our <span class=\"wojo primary text\">Plugins</span></h3>\n<p>Both of these plugins are included in cms pro base package.</p>\n  </div>\n</div>\n    </div>\n    <div class=\"row gutters\">\n<div class=\"columns tablet-100 mobile-100 phone-100\"> %%donation/paypal|plugin|1|13%% </div>\n<div class=\"columns tablet-100 mobile-100 phone-100\"> %%poll/install|plugin|1|3%% </div>\n    </div>\n  </div>\n</div>','\"\"','testimonials,carousel,plugin','testimonials,carousel,plugin','testimonials,carousel,plugin','t