(24,'Testimonial','Testimonial','Testimonial','Testimonial','<div class=\"relative\" style=\"background-image: linear-gradient(150deg, #2d1582 0%, #19a0ff 100%);background-repeat: repeat-x; padding:8rem 0\">\r\n  <div class=\"wojo-grid\">\r\n    <div class=\"row align-center\">\r\n<div class=\"columns content-center screen-60\">\r\n<figure class=\"wojo small circular image\">\r\n<img src=\"[SITEURL]/uploads/avatars/avatar_0015.jpg\" alt=\"Image Description\" data-image=\"y2kcy0km1rla\">\r\n</figure>\r\n<div class=\"wojo white thin tall large text margin-bottom\"> The template is really nice and offers quite a large set of options. It\'s beautiful and the coding is done quickly and seamlessly. Thank you! </div>\r\n<h4 class=\"wojo warning text\">Maria Muszynska</h4>\r\n</div>\r\n    </div>\r\n  </div>\r\n  <figure class=\"absolute\" style=\"bottom:-3rem;left:0;width:25%\"><svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"-19 21 8 8\">\r\n<path fill=\"#FFF\" d=\"M-15.3 26.5c0 .9-.7 1.6-1.6 1.6-.7 0-1.3-.4-1.5-1.1-.2-.5-.3-1.1-.3-1.4 0-1.6.8-2.9 2.5-3.7l.2.5c-1 .4-1.8 1.4-1.8 2.3v.4c.3-.2.6-.3.9-.3.9 0 1.6.8 1.6 1.7zm2.4-1.7c-.3 0-.6.1-.9.3v-.4c0-.9.8-1.9 1.8-2.3l-.2-.5c-1.7.8-2.5 2.1-2.5 3.7 0 .4.1.9.3 1.4.2.6.8 1.1 1.5 1.1.9 0 1.6-.7 1.6-1.6s-.7-1.7-1.6-1.7z\" opacity=\".1\"></path>\r\n    </svg></figure>\r\n  <figure class=\"absolute\" style=\"left:0;bottom:0;width:100%\"><svg xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" width=\"100%\" height=\"140px\" data-parent=\"#SVGwave1BottomSMShape\" preserveAspectRatio=\"none\" style=\"margin-bottom:-8px\" viewBox=\"0 0 300 100\">\r\n  \r\n<defs>\r\n<path id=\"waveBottom1SMID1\" d=\"M0 0h300v100H0z\"></path>\r\n</defs>\r\n<clipPath id=\"waveBottom1SMID2\">\r\n<use overflow=\"visible\" xlink:href=\"#waveBottom1SMID1\"></use>\r\n</clipPath>\r\n<path fill=\"#fff\" d=\"M10.9 63.9s42.9-34.5 87.5-14.2c77.3 35.1 113.3-2 146.6-4.7 48.7-4 70 16.2 70 16.2v54.4H10.9V63.9z\" clip-path=\"url(#waveBo